column3:
原名：巴哈迪尔江·艾哈迈多夫（Bahodirjon Ahmedov)艺名或化名：乌孜米尔(UZmir)1997年出生于乌兹别克斯坦的费尔干纳市，他有母亲和有一个弟弟，他从2012年开始唱歌2014年UZmir跟Minor开始唱歌UZmir以前唱过好多的歌曲，他还有跟费尔干纳市的好多说唱歌手大赛过，他主要是跟Mira米拉唱歌 他跟别的歌手唱歌次数确实挺少，然而UZmir有自己独特风格的歌手他的唱的歌曲是独特完美的，目前他的粉丝越来越增多了最近跟Mira一起唱的Poralab这首歌全网播放量已超过1亿了他一直在不断努力为粉丝发布了新作品，有时候他还一周唱一首歌， 谢谢喜欢UZmir的每一位粉丝 希望UZmir的以后艺术道路越来越红红。
